  checkFPXBankList() {
    this._httpService.get(this.appUrlService.appRootUrl + 'assets/qstl/banklist.json').subscribe(
      (result) => {
        let res = JSON.parse(JSON.stringify(result));
        //console.log('FPX Bank List: ' + res);
        let lastCheck = moment(res.LastCheck);
        let hours = moment().diff(lastCheck, 'hours');
        if ((res.PersonalBank.length === 0 || res.CorporateBank.length === 0) || (res.LastCheck === null || hours >= 24)) {
          this.getBankList();
        } else {
          this.personalBank = res.PersonalBank;
          this.corpBank = res.CorporateBank;
        }
      });
  }

  historyCheck(transno?: string) {
    // if (status === '2') {
    //   this.inputHelper.status = 'Paid';
    // } else if (status === '1') {
    //   this.inputHelper.status = 'Pending';
    // } else if (status === '3') {
    //   this.inputHelper.status = 'Cancel';
    // } else {
    //   this.inputHelper.status = 'Unpaid';
    // }

    let url = ProxyURL.GetPaymentHistoryDetails;
    url += 'transNo=' + encodeURIComponent('' + transno) + '&';

    if (url !== undefined) {
      this._proxy.request(url, RequestType.Get)
        .subscribe(result => {
          this.inputHelper.billno = result.transHdr.BillNo;
          this.tableItems2 = result.transDtl.items;
          this.inputHelper.billdate = moment(result.transHdr.Date).format('DD/MM/YYYY');
          this.inputHelper.customer = result.transHdr.Company;
          this.inputHelper.attn = result.transHdr.Attn;
          this.inputHelper.customer = result.transHdr.Company;
          this.inputHelper.receiptno = result.transHdr.CustPrivilege;
          this.inputHelper.digitalsign = result.transHdr.SpDiscRemark;

          if ((result.transHdr.CashSaleAddr === '|||' || result.transHdr.CashSaleAddr === '||') || result.transHdr.CashSaleAddr === '|') {
            this.inputHelper.address = result.transHdr.Address1 + ' ' + result.transHdr.Address2 + ' ' + result.transHdr.Address3;
          } else if (result.transHdr.CashSaleAddr !== '') {
            this.inputHelper.address = result.transHdr.CashSaleAddr.replace(/\|/g, ', ');
          } else {
            this.inputHelper.address = result.transHdr.Address1 + ' ' + result.transHdr.Address2 + ' ' + result.transHdr.Address3;
          }

          result.transTender.TenderID === '996' ? this.inputHelper.deliveryref = 'MayBank' : result.transTender.TenderID === '997' ? this.inputHelper.deliveryref = 'FPX' : this.inputHelper.deliveryref = 'Via Offline Payment';

          //this.inputHelper.subtotal = result.transDtl.items.map(x => x.SubTotal).reduce((a, b) => a + b, 0);
          this.inputHelper.sst = result.transHdr.Tax;
          this.taxAmt = this.inputHelper.sst;
          this.inputHelper.valueRounding = result.transHdr.Rounding;
          this.Rounding = this.inputHelper.valueRounding;
          this.inputHelper.total = result.transHdr.Amount;
          this.inputHelper.subtotal = result.transHdr.TransSubTotal;

          this.inputHelper.totalamountdue = this.inputHelper.total;

          if (result.transHdr.PaidStatus === 'Paid') {
            this.inputHelper.status = 'Paid';
            this.inputHelper.totalamountdue = '0';
          } else if (result.transHdr.PaidStatus === 'Pending') {
            this.inputHelper.status = 'Pending';
          } else if (result.transHdr.PaidStatus.includes('Cancel')) {
            this.inputHelper.status = 'Cancel';
          } else {
            this.inputHelper.status = 'Unpaid';
          }

          this.inputHelper.taxcatcode = result.transHdr.TaxCatCode === '' ? '-' : result.transHdr.TaxCatCode;
          this.inputHelper.costcenter = result.transHdr.TransReasonCode === '' ? '-' : result.transHdr.TransReasonCode;
          this.PaymentHistoryMultiple = true;

          this.primengTableHelper.records = result.transDtl.items;

          this.inputHelper.type = result.transDtl.items[0].Type;

          this.inputHelper.refInfo = result.transTender.RefToken;
          this.inputHelper.respCode = result.transTender.RespCode;

          this.inputHelper.ourref = result.transHdr.OurRef === '' ? '-' : result.transHdr.OurRef;
          this.inputHelper.yourref = result.transHdr.YourRef === '' ? '-' : result.transHdr.YourRef;
          this.inputHelper.refno = result.transHdr.RefNo === '' ? '-' : result.transHdr.RefNo;
          this.inputHelper.customerno = result.transHdr.CustomerNo;
          this.inputHelper.creditvote = result.transHdr.CreditVote === '' ? '-' : result.transHdr.CreditVote;
          this.inputHelper.projectcode = result.transHdr.ProjectCode === '' ? '-' : result.transHdr.ProjectCode;
          this.inputHelper.ExternalID = result.transTender.ExternalID;
          this.inputHelper.ItemType = result.transDtl.items[0].ItemType;
          this.inputHelper.StkType = result.transDtl.items[0].StkType;
          this.printType = PrintToPdf.CashBill;
          this.sstAmt = 6;

          if (this.inputHelper.StkType === 'CSH') {
            this.PaymentHistory = true;
            this.PaymentHistoryMultiple = false;
            this.printType = PrintToPdf.CashBill;
          } else if (this.inputHelper.ItemType === 0) {
            this.PaymentHistory = true;
            this.PaymentHistoryMultiple = false;
            this.printType = PrintToPdf.SingleReceipt;
          } else if (this.inputHelper.ItemType === 1) {
            this.PaymentHistory = false;
            this.PaymentHistoryMultiple = true;
            this.printType = PrintToPdf.ProformaBill;
          }

          this.inputHelper.TotalCount = (result.transDtl.totalCount * 5);

          // if (status === '0' || (status === '1' || status === '2')) {
          if (!result.transHdr.PaidStatus.includes('Cancel')) {
            console.log('Verify Update Transaction While Status not Cancelled');
            this.updateTransaction(transno);
          }

          //this.inputHelper.sst = this.inputHelper.taxAmountHistory;
          //this.validatePaymentStatus(this.inputHelper.refInfo, transno, status, result.transTender.TenderID);

          if (this.inputHelper.type === 'Credit Bill') {
            this.InvoiceTitle = 'Receipt';
            this.pageTitle = 'Receipt Detail';
            this._invoiceCont = undefined;
            this.inputHelper.shorttype = 'CR';
          } else if (this.inputHelper.type === 'Proforma Bill') {
            this.InvoiceTitle = 'Receipt';
            this.pageTitle = 'Receipt Detail';
            this._invoiceCont = undefined;
            this.inputHelper.shorttype = 'PF';
          } else if (this.inputHelper.type === 'Cash Bill') {
            this.InvoiceTitle = 'Receipt';
            this.pageTitle = 'Receipt Detail';
            this._invoiceCont = undefined;
            this.isCashBill = true;
            this.inputHelper.shorttype = 'CS';
          }
        });
    }
  }

  exportToTxtAspx(transno?: string, taxAmt?: number, Rounding?: number): void {
    let url = ProxyURL.GetTextFileString;
    url += 'transNo=' + transno + '&' + 'TaxAmt=' + taxAmt + '&' + 'Rounding=' + Rounding + '&';

    this.notify.warn(this.l('PopulatingData'));
    this._proxy.request(url, RequestType.Get)
      .subscribe((result) => {
        this.txtHelper.textinvoice = result;
        this.txtHelper.billtype = this.inputHelper.shorttype;

        setTimeout(() => {
          let form = (document.getElementById('txtForm') as HTMLFormElement);

          form.setAttribute('target', '_blank');
          form.action = AppConsts.DownloadText.URL;
          form.submit();
          form.removeAttribute('target');

          this.notify.info(this.l('DownloadingFile'));
        }, 3);
      });
  }

